import React, { Component, Fragment } from "react";
import EmbeddedVideo from "./embeddedVideo.js";
import Filter from "./filter.js";
import "./middleRow.css";
import "./embeddedVideo.css";
class MiddleRow extends Component {
  render() {
    return (
      <div className="middle">
        <EmbeddedVideo url={this.props.url} />
        <Filter changeFunction={this.props.updateCategory(categoryNumber)}/>
      </div>
    );
  }
}
export default MiddleRow;
